import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import {State, Union} from './helpline';
import { Background } from 'devextreme-react/range-selector';

const useStyles = makeStyles({
  table: {
    width: "100%",
    top:100,
    maxWidth: 650,
    position:"relative",
    margin:"auto",
    backgroundColor:"white"
  },
});

function TableHelp(props) {
    const classes = useStyles();

    return(
        <div className="Table">
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell><b>Name of the State</b></TableCell>
            <TableCell align="right"><b>Helpline Numbers</b></TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {props.help.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.state}
              </TableCell>
              <TableCell align="right">{row.phone}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </div>
    )
}

export default function SimpleTable() {
  

  return (
    <div>
        <TableHelp help={State} />
    </div>
  );
}
